import React from 'react';
import ProductList from './App/Page/ProductList';

const useStyles = makeStyles({
  root: {
    padding: '20px',  
  }, 
  card: { 
    maxWidth: 345, 
    margin: 'auto', 
    position: 'relative', 
  }, 
  media: {
    height: 140, 
  }, 
  deleteButton: {
    position: 'absolute', 
    top: 10, 
    right: 10, 
  },  
}); 

const App = () => {
  return (
    <div>
      <ProductList />
    </div>
  );
};

export default App;
